import React from 'react';
import Iframe from 'react-iframe';

function PatientSymptom() {
  return (
    <div>
      <h1>Embedded Webpage</h1>
      <Iframe
        url="https://www.example.com"
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
        allowFullScreen
      />
    </div>
  );
}

export default PatientSymptom;
